import React from 'react';
import "./work.css";

function Work() {
  return (
    <section className="work section" id="portfolio">
        <h2 className="section__title">
            <spam className="section__subtitle">
                Recent Works
            </spam>
        </h2>
    </section>
  )
}

export default Work;
